import React from "react";

const AboutMe = props => (
  <div className="conte">
    <h1 class="major">Hello, my name is Janeth Arriola.</h1>
    <p>
      I currently work as a<strong>full-stack web developer</strong> and enjoy
      challenging tasks, team collaboration and added responsibility. I am a
      problem solver working to constantly expand my knowledge. I am
      self-driven, detail- oriented, adaptable, and coachable, and hope to get
      the chance to work on high-impact projects.
    </p>
  </div>
);

export default AboutMe;
